import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from "react-bootstrap";

const CustomButton = (props) => {
  return (
    <Link to={props.to}>
      <Button
        className='btn btn--outline btn--large'
      >
        {props.label}
      </Button>
    </Link>
  );
}

export default CustomButton;
